import React from "react"
const csstyle = {}
var time = new Date().getHours()
var greet = ''
if(time > 7 && time < 11){
    greet = "Good Morning"; 
    csstyle.color = "green";
}else if (time > 11 && time < 19) {
    greet = "Good Afternoon";
    csstyle.color = "orange";
} else {
    greet = "Good night";
    csstyle.color = "black";
    };

function Heading (){
    return  <h1>Hello , <span style={csstyle}>{greet}</span></h1>
}

const cstyle = {}
cstyle.width = "18rem";
function Card(props){
    return (
        <>
        <div className="card" style={cstyle}>
            <div className ="text-center">   
            <img src={props.imgsrc} className="rounded" alt="..."/>
            </div>
            <div className="card-body">
                <h5 className="card-title">{props.title}</h5>
                <p className="card-text"> {props.catorg} </p>
                <a href={props.link} className="btn btn-primary">Go somewhere</a>
            </div>
        </div>
        </>
    )


}

export default Heading;

export {time,Card};
